INSERT INTO `proyectos` (`ID_PROYECTO`, `ID_AREA`, `PROYECTO_NOMBRE`, `URL`, `PROYECTO_DESCRIPCION`, `IMAGEN`, `IMAGEN_FONDO`, `DURACION`, `FECHA_INICIO`, `FECHA_FINAL`, `FECHA_ENTREGA`, `ENLACE_ENTREGABLE`, `ENLACE_EDITABLE`, `COLOR`, `TIPO`, `PRIORIDAD`, `ESTADO`, `ORDEN`, `VALIDACION`, `ID_LISTA`) VALUES (39, 1, '03C.07_POA_DTE_Componente_1_2023', '03c07_poa_dte_componente_1_2023', '<p><b>Programa de capacitación sobre el uso de la identidad institucional y \r\nrecursos educativos en las direcciones de PL-SEP implementado.</b></p><p>Nombre del indicador. Porcentaje de recursos educativos e informativos de PL-SEP que cuentan con la identidad institucional.</p><p>Definición. Mide el porcentaje de recursos educativos e informativos de PL-SEP que cuentan con la identidad institucional.</p><p>Medios de verificación. Documento diagnóstico, paquete gráfico de identidad institucional, curso o taller de capacitación y bitácora de revisión y retroalimentación de cada dirección de PL-SEP.</p><p>Tendencia: Ascendente</p><p>Meta programada para 2023. 50%<br></p>', 'default.jpg', 'fondo_default.jpg', 'temporal', '2023-03-01', '2023-12-29', NULL, 'https://drive.google.com/drive/folders/1YJpB3E1-D99XdXI-dzWGD9eeWGLYdBpg?usp=share_link', '', 'primary', 'general', 'normal', 'activo', 0, 'si', 0);
