INSERT INTO `proyectos` (`ID_PROYECTO`, `ID_AREA`, `PROYECTO_NOMBRE`, `URL`, `PROYECTO_DESCRIPCION`, `IMAGEN`, `IMAGEN_FONDO`, `DURACION`, `FECHA_INICIO`, `FECHA_FINAL`, `FECHA_ENTREGA`, `ENLACE_ENTREGABLE`, `ENLACE_EDITABLE`, `COLOR`, `TIPO`, `PRIORIDAD`, `ESTADO`, `ORDEN`, `VALIDACION`, `ID_LISTA`) VALUES (56, 1, '01S.01_Pruebas_Lista_de_cotejo_2023', '01s01_pruebas_lista_de_cotejo_2023', '<p><span style=\"font-size: 14px;\">¡Hola!</span></p><p><span style=\"font-size: 14px;\">Comparto con ustedes el proyecto para que puedan hacer sus asignaciones de tareas con listas de cotejo, pueden hacer el ejercicio de asignar a cualquiera que se encuentre en este proyecto para que puedan visualizar como se generan los procesos.</span></p><p><span style=\"font-size: 14px;\">En la siguiente liga podrán tener acceso a las </span><a href=\"https://drive.google.com/drive/folders/1I5xBgapqHRO4Re73O1MbBtlrnIeQ7tQN\" target=\"_blank\"><u>listas de cotejo y a el registro de incidencias</u></a><span style=\"font-size: 14px;\">&nbsp;considerar lo siguiente para el llenado de incidencias:</span></p><ul><li><span style=\"text-align: var(--bs-body-text-align);\"><b>08C.20_POLARIS_INCIDENCIAS_2023</b>. Incidencias en general, sobre la navegación o errores en las secciones de Polaris.</span></li><li><span style=\"text-align: var(--bs-body-text-align);\"><b>08C.20_Lista_Cotejo_Incidencias_2023</b>: Incidencias que atañen sólo a la creación, modificación o asignación de listas de cotejo.&nbsp;</span></li></ul><p>Si tienen alguna duda, Andrés y yo estaremos atentos para ayudarlos.</p><p>Tarea asignada sólo a:</p><p><b>Gaby, Saray, Javier, Danna, Liz, Eduardo y Mario.&nbsp;</b></p><p>Saludos ????</p>', 'default.jpg', 'fondo_default.jpg', 'temporal', '2023-07-14', '2023-08-12', NULL, 'https://drive.google.com/drive/folders/1I5xBgapqHRO4Re73O1MbBtlrnIeQ7tQN', 'https://drive.google.com/drive/folders/1I5xBgapqHRO4Re73O1MbBtlrnIeQ7tQN', 'primary', 'general', 'normal', 'activo', 0, 'si', 0);
