INSERT INTO `tareas` (`ID_TAREA`, `ID_AREA`, `ID_PROYECTO`, `ID_TAREA_PADRE`, `ID_USUARIO`, `TAREA_DIA_COMPLETO`, `FECHA_INICIO`, `FECHA_FINAL`, `FECHA_ENTREGA`, `TAREA_TITULO`, `TAREA_DESCRIPCION`, `TAREA_ENLACE_ENTREGABLE`, `TAREA_ENLACE_EDITABLES`, `PRIORIDAD`, `COLOR`, `TIPO`, `ESTADO`, `ID_PROCESO`) VALUES (203, 1, 39, 0, NULL, 'si', '2023-03-15', '2023-03-28', NULL, 'Cronograma', '<p>2023<br>GENERAL - 28 de marzo<br>1. Cronograma general<br>2. Crear justificación<br><br>DIAGNOSTICO (Direcciones)<br>1. Crear el formulario (asignar enlace de comunicación y asesor por dirección, establecer relación, actividades y perfil - incluir opción para sesión presencial)(COM-PROD)<br>2. Sesión con directores (argumentar la importancia de la implementación)<br>3. Implementación del formulario<br>4. Interpretación de resultados<br>5. Sesión con enlaces de comunicación (sesiones de capacitación e información)<br><br>PAQUETES GRÁFICOS<br>1. Plan satisfacer las necesidades del formulario (armar paquete de insumos de identidad)<br>2. Entrega de paquetes<br>3. Sesiones informativas (COM-PROD) con temas generales de identidad y pertenencia (comunidad PL-SEP - finales de año)<br><br>2024<br>1. Sesiones de contexto de cambio de administración<br>2. Taller de implementación de identidad<br>3. Periodo de validación (DTE-temporal 6 meses | Enlaces permanentes, con posibilidad de acercarse a la DTE)<br></p>', 'https://drive.google.com/drive/folders/1YJpB3E1-D99XdXI-dzWGD9eeWGLYdBpg?usp=share_link', '', 'normal', 'primary', 'general', 'en desarrollo', 142);
